function populateFavorites(){$(".favorites li").each(function(){var e=$(this);$.ajax({type:"GET",url:"/getArtist/"+e.data("id"),dataType:"json",success:function(o){e.find(".collapsible-header .circle").attr("src",o.images[0].uri),console.log(o),e.find(".collapsible-header").text(o.name),e.find(".collapsible-body").text(o.profile)},error:function(){console.log("Error")}})})}$(document).ready(function(){$("ul.tabs").tabs(),$(".button-collapse").sideNav(),$(".collapsible").collapsible(),populateFavorites()});